import clsx from 'clsx';
import React from 'react';

interface ButtonProps {
    handler?: () => void;
    className?: string;
}
const CustomButtons = ({ handler, className }: ButtonProps) => {
    const classNames = clsx('buttonclass', className)
    return (
        <div>
            <button onClick={handler} className={classNames}>Click Me</button>
        </div>
    );
};

export default CustomButtons;
